import React from 'react';
import { TextField, Button, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    alignItems: 'center',
    position: 'fixed',
    bottom: 0,
    width: '100%',
    padding: theme.spacing(2),
    backgroundColor: theme.palette.background.default,
    borderTop: '1px solid #fff', // White outline
  },
  textField: {
    marginRight: theme.spacing(2),
  },
  sendButton: {
    marginLeft: 'auto',
  },
}));

const TextBoxWithSendButton = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <TextField
        className={classes.textField}
        variant="outlined"
        placeholder="Type your message..."
      />
      <Button className={classes.sendButton} variant="contained" color="primary">
        Send
      </Button>
    </div>
  );
};

export default TextBoxWithSendButton;
